		; Load memory pointers
		getcr s2, 0
		add_i s1, s2, 4 ; (start of data segment)
		shl s1, s1, 16 ; (multiply by 64k)
		move s8, 1
		shl s8, s8, 16
		sub_i s8, s8, 1
loop0: 	add_i_mask v0, s8, v0, 8
		shr s8, s8, 1
		btrue s8, loop0
		add_i v1, v0, s1

		; Compute initial code branch address
		getcr s2, 0
		shl s2, s2, 2
		lea s3, branch_addrs
		add_i s2, s2, s3
		load_32 s2, (s2)
		move pc, s2

